import React, { useEffect, useState } from 'react';
import Footer from '../components/Footer';
import Navbar from '../components/Navbar';

export default function MyOrder() {
    const [orderData, setOrderData] = useState(null);

    const fetchMyOrder = async () => {
        const userEmail = localStorage.getItem('userEmail');
        try {
            const response = await fetch("http://localhost:5000/api/auth/myOrderData", {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify({ email: userEmail }),
            });

            const result = await response.json();
            setOrderData(result);
        } catch (error) {
            console.error("Error fetching order data:", error);
        }
    };

    useEffect(() => {
        fetchMyOrder();
    }, []);

    return (
        <div>
            <Navbar />
            <div className="container mt-4">
                <div className="row">
                    {orderData && orderData.orderData ? (
                        orderData.orderData.map((orderGroup, groupIndex) => (
                            <div key={groupIndex} className="w-100">
                                {/* Order Date */}
                                <div className="text-center my-3">
                                    <h5>Order Date: {new Date(orderGroup[1]).toLocaleDateString()}</h5>
                                    <hr />
                                </div>
                                {/* Order Items */}
                                <div className="row">
                                    {orderGroup[0].map((item, itemIndex) => (
                                        <div key={itemIndex} className="col-12 col-md-6 col-lg-3 mb-4">
                                            <div className="card" style={{ width: "16rem", maxHeight: "360px" }}>
                                                <img
                                                    src={item.img || "https://via.placeholder.com/150"}
                                                    className="card-img-top"
                                                    alt={item.name}
                                                    style={{ height: "120px", objectFit: "cover" }}
                                                />
                                                <div className="card-body">
                                                    <h5 className="card-title">{item.name}</h5>
                                                    <div className="d-flex justify-content-between">
                                                        <span>Qty: {item.qty}</span>
                                                        <span>Size: {item.size}</span>
                                                    </div>
                                                    <div className="mt-2">
                                                        <strong>â‚¹{item.price}/-</strong>
                                                    </div>
                                                </div>
                                            </div>
                                        </div>
                                    ))}
                                </div>
                            </div>
                        ))
                    ) : (
                        <div className="text-center">No orders found.</div>
                    )}
                </div>
            </div>
            <Footer />
        </div>
    );
}
